import {
  init_buffer,
  init_process
} from "./chunk-AZLL6FY2.mjs";

// ../../node_modules/idb-keyval/dist/index.js
init_process();
init_buffer();
function promisifyRequest(request) {
  return new Promise((resolve, reject) => {
    request.oncomplete = request.onsuccess = () => resolve(request.result);
    request.onabort = request.onerror = () => reject(request.error);
  });
}
function createStore(dbName, storeName) {
  const request = indexedDB.open(dbName);
  request.onupgradeneeded = () => request.result.createObjectStore(storeName);
  const dbp = promisifyRequest(request);
  return (txMode, callback) => dbp.then((db) => callback(db.transaction(storeName, txMode).objectStore(storeName)));
}
var defaultGetStoreFunc;
function defaultGetStore() {
  if (!defaultGetStoreFunc) {
    defaultGetStoreFunc = createStore("keyval-store", "keyval");
  }
  return defaultGetStoreFunc;
}
function get(key, customStore = defaultGetStore()) {
  return customStore("readonly", (store) => promisifyRequest(store.get(key)));
}
function set(key, value, customStore = defaultGetStore()) {
  return customStore("readwrite", (store) => {
    store.put(value, key);
    return promisifyRequest(store.transaction);
  });
}
function del(key, customStore = defaultGetStore()) {
  return customStore("readwrite", (store) => {
    store.delete(key);
    return promisifyRequest(store.transaction);
  });
}

// src/filesystem/resources/sticker.png
var sticker_default = "data:image/png;base64,";

// src/vividProvider/constants/databaseVersion.ts
init_process();
init_buffer();
var DATABASE_VERSION = "0";

// src/analytics/constants/email.ts
init_process();
init_buffer();
var STORE_EMAIL = "VIVID_STORE_EMAIL" + DATABASE_VERSION;

export {
  get,
  set,
  del,
  DATABASE_VERSION,
  STORE_EMAIL,
  sticker_default
};
